import React, { Component } from 'react';
import './App.css';
import {Link} from "react-router-dom" 
import BookAppointment from "./BookAppointment"

class User extends React.Component{   
    
    render(){
    return (
          <div className="User">
            <div className="grid-container-1">

                <div className="signup-text">
                    <h4>User</h4>
                </div>

                <div className="container">
                  <input type="text" placeholder="Email" name="" required className="email"></input>
      
                  <input type="password" placeholder="Password" name="" required className  ="password"></input>

                  <div className="login-button">
                    <Link to={BookAppointment} className="user-login-button">login</Link>

                    <Link to="/" className="home-button">Home</Link>

                  </div>
                </div>
            </div>
          </div>
      );
    }
  }
export default User;
